[python-build]
<= build
prefix       = ${buildout:root}/python/${:version}

[python-0.9]
<= python-build
version      = 0.9
url          = ${python-sources:0.9.1}
md5sum       = ${python-md5sums:0.9.1}
configure-command = :
make-options +=
    -C src
    DEFPYTHONPATH='.:${:prefix}/lib/python${:version}'
    RL_USE='-DUSE_READLINE'
    RL_LIBS='-lreadline'
make-targets = ;
    set -ex;
    install -m 755 -d ${:prefix}/bin
               ${:prefix}/lib/python${:version}
               ${:prefix}/share/man/man1;
    install -m 755 src/python ${:prefix}/bin/python${:version};
    ln -s python${:version} ${:prefix}/bin/python;
    cp -a lib/*.py ${:prefix}/lib/python${:version};
    install -m 644 python.man ${:prefix}/share/man/man1/python${:version}.1;



[python-1.x-build]
<= python-build



[python-1.0]
<= python-1.x-build
version      = 1.0
url          = ${python-sources:1.0.1}
md5sum       = ${python-md5sums:1.0.1}
configure-options += ;
    set -ex;
    sed -i -e 's/\bgetline\b/_getline/' Objects/fileobject.c;
    sed -i -e 's/\bposix_close\b/_posix_close/' Modules/posixmodule.c;
    install -d ${:prefix}/bin
               ${:prefix}/include
               ${:prefix}/lib
               ${:prefix}/man/man1;
make-options +=
    DESTLIB='$(prefix)/lib/python${:version}'
make-targets = install libinstall maninstall inclinstall libainstall;
    set -ex;
    mv ${:prefix}/bin/python ${:prefix}/bin/python${:version};
    ln -s python${:version} ${:prefix}/bin/python;
    mv ${:prefix}/lib/python ${:prefix}/lib/python${:version} || :;
    install -d ${:prefix}/share/;
    mv ${:prefix}/man/ ${:prefix}/share/ || :;
    mv ${:prefix}/share/man/man1/python.1 ${:prefix}/share/man/man1/python${:version}.1;

